15;1;Czarownica 2 (DVD);1006,1001,1000;32.51;1;23.79;1;;;;;demo_15;demo_15;;;;;;;;;;;;;1;;0;both;;;;Film;„Czarownica 2” z Angeliną Jolie w roli głównej to dalszy ciąg historii najsłynniejszego czarnego charakteru Disneya. Po wielu wspólnych szczęśliwych latach relacja Diaboliny i jej córki chrzestnej Aurory zostaje wystawiona na ciężką próbę. Przyczyną jest zbliżający się ślub Aurory. W życiu bohaterek pojawiają się nieoczekiwani sojusznicy i nowe, mroczne siły. Ich miłość okazuje się jednak mocniejsza, dzięki czemu żyją długo i szczęśliwie.;;;;;czarownica-2-dvd;Produkt dostępny;Zamówienie dozwolone;1;;;1;;;1;Producent:Galapagos:0,Reżyseria:  Joachim Rønning  :3,Czas trwania [min]:113 :7,Kraj Produkcji:USA :8,Rok Produkcji:2019 :9,;0;new;1;;;;;;;;;;;;;
16;1;X-Men: Mroczna Phoenix (DVD);1006,1001,1000;24.38;1;17.84;1;;;;;demo_16;demo_16;;;;;;;;;;;;;1;;0;both;;;;Film;Sophie Turner, James McAvoy, Michael Fassbender i Jennifer Lawrence przewodzą gwiazdorskiej obsadzie w tym pasjonującym, widowiskowym filmie stanowiącym swoisty punk kulminacyjny sagi o X-Menach. Podczas kosmicznej misji ratunkowej Jean Grey (Turner) przekształca się w nieskończenie potężną i niebezpieczną MROCZNĄ PHOENIX. Gdy Jane, a właściwie jej alter ego wymyka się spod kontroli, X-Meni muszą się zjednoczyć, by stawić czoła najgroźniejszemu wrogowi - obdarzonemu najbardziej niszczycielską siłą, jakiej świat dotąd nie widział -  jednemu z nich.;;;;;x-men-mroczna-phoenix-dvd;Produkt dostępny;Zamówienie dozwolone;1;;;1;;;1;Producent:Imperial Cinepix:0,Reżyseria:  Simon Kinberg  :3,Czas trwania [min]:109 :7,Kraj Produkcji:USA :8,Rok Produkcji:2019 :9,;0;new;1;;;;;;;;;;;;;
17;1;Urge;1007,1001,1000;4.06;1;2.97;1;;;;;demo_17;demo_17;;;;;;;;;;;;;1;;0;both;;;;Film;Pierce Brosnan („Ocalona”, „November Man”), Danny Masterton („Różowe lata 70.”) i Justin Chatwin („Niewidzialny”, „Wojna światów”) w reżyserskim debiucie Aarona Kaufmana, producenta „Sin City 2: Damulka warta grzechu” i „Maczeta zabija”.Czwórka przyjaciół zamierza spędzić szampański weekend na tropikalnej wyspie. Zabawa nabiera tempa, gdy poznają tajemniczego właściciela klubu nocnego (Pierce Brosnan), który proponuje im spróbowanie nowego, eksperymentalnego narkotyku. Pobudzeni, pozbawieni zahamowań, wcielają w życie swoje najdziksze fantazje. Gdy zafascynowani tajemniczą substancją decydują się powtórzyć dawkę, narkotyk wywołuje nieoczekiwane efekty uboczne, a pobyt na rajskiej wyspie zamienia się w koszmar rodem z domu wariatów.;;;;;urge;Produkt dostępny;Zamówienie dozwolone;1;;;1;;;1;Producent:Monolith:0,Reżyseria:  Aaron Kaufman  :3,Czas trwania [min]:87 :5,Kraj Produkcji:USA :6,Rok Produkcji:2016 :7,;0;new;1;;;;;;;;;;;;;
